import React ,{ Component } from 'react'
import { Select } from 'semantic-ui-react'

const types = []

class FilterSelect extends Component{

    collectTargetTypes = () => {
        if(this.props.data){
            this.props.data.map((post)=> {
                Object.keys(post.targeting).map((property)=>{
                    if(!types.includes(property)){
                        types.push(property)
                    }
                         }) 
                    })
        }
    }

    assignKeys = () => {
        this.collectTargetTypes()
        if(types){
            types.map((type)=>{
                console.log(type.replace(/_/, ' '))
            })
        }
    }



    render(){
        this.assignKeys()
        return(
            <Select compact options={''} defaultValue='articles' />
        )
    }
}

export default FilterSelect
